    public class LiseHFCalibration : IProbeCalibration
    {
        private readonly CalibrationManager _calibrationManager;
        private readonly AnaHardwareManager _hardwareManager;
        private readonly ProbeLiseHFConfig _configProbeLiseHf;

        private ILogger _logger;
        private CancellationTokenSource _cancellationTokenSrc;

        public bool IsCalibrationValid { get; set; }

        public IProbe Probe { get; set; }
        public int LiseHFSpotCalibrationFlow_StatusChanged { get; private set; }

        private List<double> _simulatedWave = null;
        private List<double> _simulatedDark = null;
        private List<double> _simulatedRef = null;

        public LiseHFCalibration(ProbeLiseHF probeLiseHF, ILogger logger)
        {
            _hardwareManager = ClassLocator.Default.GetInstance<AnaHardwareManager>();
            _calibrationManager = ClassLocator.Default.GetInstance<CalibrationManager>();

            Probe = probeLiseHF;
            _logger = logger;

            if (Probe.Configuration.IsSimulated)
            {
                InitSimulatedCalibrationSignals();
            }
            _configProbeLiseHf = probeLiseHF.Configuration as ProbeLiseHFConfig;

        }

        public bool StartCalibration(IProbeCalibParams probeCalibParams, IProbeInputParams inputParameters)
        {
            _cancellationTokenSrc = new CancellationTokenSource();
            var inputacq = inputParameters as LiseHFInputParams;
            if (inputacq == null)
            {
                _logger.Error("Bad param for a Probe Lise HF");
                return false;
            }
            var myProbeLiseHF = Probe as ProbeLiseHF;
            if (myProbeLiseHF == null)
            {
                _logger.Error("HW Probe is not a Probe Lise HF");
                return false;
            }

            if (Probe.Configuration.IsSimulated)
            {
                var cancellationTriggered = _cancellationTokenSrc.Token.WaitHandle.WaitOne(1000);
                if (cancellationTriggered)
                {
                    // Cleanup
                    IsCalibrationValid = false;
                    return false;
                }
                IsCalibrationValid = true;

                Task.Run(() =>
                {
                    var resCalib = DoDummyCalibration(probeCalibParams, inputParameters);
                    if (resCalib != null)
                    {

                        NotifyCalibrationResultsAvailable(resCalib);
                        myProbeLiseHF.CalibrationManager.SetCalibration(myProbeLiseHF.DeviceID, resCalib, inputParameters, null);
                    }
                    else
                        NotifyCalibrationResultsAvailable(new ProbeLiseHFCalibResult() { Success = false });
                });
                return true;
            }
            else
            {
                Task.Run(() =>
                {
                    var resCalib = DoCalibration(probeCalibParams, inputParameters,_cancellationTokenSrc.Token);
                    if (resCalib != null)
                    {
                        NotifyCalibrationResultsAvailable(resCalib);
                        myProbeLiseHF.CalibrationManager.SetCalibration(myProbeLiseHF.DeviceID, resCalib, inputParameters, null);
                    }
                    else
                        NotifyCalibrationResultsAvailable(new ProbeLiseHFCalibResult() { Success = false });
                });
            }

            return true;
        }

        public void CancelCalibration()
        {
            _cancellationTokenSrc.Cancel();
        }

        public ProbeLiseHFCalibResult DoCalibration(IProbeCalibParams probeCalibParams, IProbeInputParams inputParameters, CancellationToken cancellationToken)
        {
            _logger.Information("Start Calibration LiseHF");
            var inputacq = inputParameters as LiseHFInputParams;
            var myProbeLiseHF = Probe as ProbeLiseHF;

            const double satthreshold = 65535.0;
            const int spectroPixelCount = 4096;

            try
            {
                //This is the persistent integration time calibration 
                var integrationTimeCalibration = _calibrationManager.GetLiseHFObjectiveIntegrationTime(inputacq.ObjectiveId);
                if (integrationTimeCalibration == null)
                    throw new Exception($"No integration time calibration has been set in HW Config for Objective <{inputacq.ObjectiveId}>");

                var integrationTime_ms = inputacq.IsLowIlluminationPower
                    ? integrationTimeCalibration.LowIllumFilterIntegrationTime_ms
                    : integrationTimeCalibration.StandardFilterIntegrationTime_ms;

               
                // Do the real calibration (not simulated)
                myProbeLiseHF.StopContinuousAcquisition();

                var cancellationTriggered = cancellationToken.WaitHandle.WaitOne(500);
                if (cancellationTriggered)
                    throw new Exception("Cancel request");

                myProbeLiseHF.Status = ProbeStatus.Calibration;
                var chuckConfig = _hardwareManager.Chuck.Configuration as ANAChuckConfig;
                var reflist = chuckConfig.ReferencesList;

                // DARK CALIBRATION
                //
                var RefDark = reflist.Find(x => x.ReferenceName == "REF DARK");
                if (RefDark == null)
                    throw new Exception("No DARK Optical ref has been set in HW Config");
                _logger.Debug($"Move to DARK Ref (Defocused)");
                HardwareUtils.MoveAxesToOpticalReference(_hardwareManager, RefDark);

                //De-focus a bit as requested for a better rendering (cf Michael Schobitz)
                var defocusOffsetZ = 1.Millimeters();
                HardwareUtils.MoveIncremental(_hardwareManager.Axes, new XYZTopZBottomMove(double.NaN, double.NaN, defocusOffsetZ.Millimeters, double.NaN));

                if (cancellationToken.IsCancellationRequested)
                    throw new Exception("Cancel request");

                _logger.Debug($"Performing Dark Calibration ...");
                var DarkRawAcq = myProbeLiseHF.DarkCalibration(inputacq.ObjectiveId, inputacq.IsLowIlluminationPower, integrationTime_ms ,_configProbeLiseHf.CalibrationNbAverage);
            
                double normalScaleFactor = myProbeLiseHF.GetNormScaleFactor();
                double MaxDark = DarkRawAcq.RawSignal.Max() * normalScaleFactor; //  signal is normalized by ScaleFactor for TTM prupose now, real saturation need to be update by x Integ Time  
                double SatDark = MaxDark / satthreshold;
                var IsDarkValid = DarkRawAcq.RawSignal.Count == spectroPixelCount ? "OK" : "NOK";
                _logger.Information($"Dark Calibration : Sat={SatDark * 100.0}% ({IsDarkValid}) integration_time={integrationTime_ms}");

                // REFERENCE SILICON CALIBRATION
                //
                var RefSi = reflist.Find(x => x.ReferenceName == "REF SI");
                if (RefSi == null)
                    throw new Exception("No SI Optical ref has been set in HW Config");
                _logger.Debug($"Move to SI Ref");
                HardwareUtils.MoveAxesToOpticalReference(_hardwareManager, RefSi);

                if (cancellationToken.IsCancellationRequested)
                    throw new Exception("Cancel request");

                _logger.Debug($"Performing Reference Calibration ...");
                var RefRawAcq = myProbeLiseHF.RefCalibration(inputacq.ObjectiveId, inputacq.IsLowIlluminationPower, integrationTime_ms, _configProbeLiseHf.CalibrationNbAverage);

                double Maxref = RefRawAcq.RawSignal.Max() * normalScaleFactor; //  signal is normalized by integration time for TTM prupose now, real saturation need to be update by x Integ Time  
                double Satref = Maxref / satthreshold;
                var IsRefValid = RefRawAcq.RawSignal.Count == spectroPixelCount ? "OK" : "NOK";
                _logger.Information($"Reference Calibration : Sat={Satref * 100.0}% ({IsRefValid}) integration_time={integrationTime_ms}");
                // SPOT LISE HF OFFSET FOR FDC
                //
                var globalStatusServer = ClassLocator.Default.GetInstance<IGlobalStatusServer>();
                if (globalStatusServer.GetControlMode() == PMControlMode.Production)
                    MeasureLiseHFSpotOffsetAndSendFDCs(myProbeLiseHF.DeviceID, inputacq.ObjectiveId);

                // calculate saturation threshold
                double Saturation = Math.Max(SatDark, Satref);

                // Previous version commented below : to removed when liseHF TTM will be completely validated and fixed after LiseHF v2 box
                // IsCalibrationValid = (RefRawAcq.RawSignal.Count == spectroPixelCount) && (DarkRawAcq.RawSignal.Count == spectroPixelCount) && Saturation <= 0.995;
                // Note RTI : since we don't have so much data yet concerning ttm, we comment saturation as a criteria for calibration acceptance
                // especially since calibration now depends also of Max Spectrum value in count (standard at 50000 but could be also 25000 or less in case of lack of power)
                IsCalibrationValid = (RefRawAcq.RawSignal.Count == spectroPixelCount) && (DarkRawAcq.RawSignal.Count == spectroPixelCount);
                if (!IsCalibrationValid)
                    _logger.Error($"Calibration LiseHF Not valid : Sat = {Saturation * 100.0}% rfcnt = {RefRawAcq.RawSignal.Count} | dkcnt = {DarkRawAcq.RawSignal.Count} != {spectroPixelCount}");

                var probeCalibration = new ProbeLiseHFCalibResult()
                {
                    Success = IsCalibrationValid,
                    ObjectiveId = inputacq.ObjectiveId,
                    IntegrationTime_ms = integrationTime_ms,
                    AttenuationId = ProbeLiseHF.IlluminationToSliderID(inputacq.IsLowIlluminationPower),
                    NbAverage = inputacq.NbMeasuresAverage,
                    DarkRawSignal = DarkRawAcq,
                    RefRawSignal = RefRawAcq,
                };

                return probeCalibration;

            }
            catch (Exception ex)
            {
                IsCalibrationValid = false;
                _logger.Error($"Calibration LiseHF Fail : {ex.Message}");
                // notify error
                NotifyCalibrationResultsAvailable(new ProbeLiseHFCalibResult() { Success = false, ErrorMessage = ex.Message });
            }
            finally
            {
                // close shutter for safety
                myProbeLiseHF.CloseShutterAndWait(800); //should be already closed when called
                _logger.Information("Calibration LiseHF Terminated");

                myProbeLiseHF.Status = ProbeStatus.Initialized;
            }
            return null;
        }

        private void MeasureLiseHFSpotOffsetAndSendFDCs(string probeId, string objectiveId)
        {
            var probeLiseHFFDCProvider = ClassLocator.Default.GetInstance<ProbeLiseHFFDCProvider>();

            if (!probeLiseHFFDCProvider.IsNeededToSendFDCLiseHFSpotOffsetDeviation())
            {
                return;
            }

            var objectiveSpotPosition = _calibrationManager.GetLiseHFObjectiveSpotPosition(objectiveId);

            if (objectiveSpotPosition is null)
            {
                _logger.Error($"Failed to retrive LiseHF spot position for the objective : {objectiveId}");
                return;
            }

            var camExposureTime = (objectiveSpotPosition as LiseHFObjectiveSpotCalibration).CamExposureTime_ms;

            if (camExposureTime == 0.0)
            {
                var globalStatusServer = ClassLocator.Default.GetInstance<IGlobalStatusServer>();
                var mess = "Failed to send LiseHF spots offsets FDCs : A new Lise HF spots offsets calibration is required";
                globalStatusServer.SetGlobalStatus(new GlobalStatus(new Message(MessageLevel.Error, mess)));
                _logger.Error(mess);
                return;
            }


            var flowsAreSimulated = ClassLocator.Default.GetInstance<IPMServiceConfigurationManager>().FlowsAreSimulated;
            // if flows are simulated we do nothing
            if (flowsAreSimulated)
            {
                return;
            }

            var input = new LiseHFSpotCheckInput(probeId, objectiveId, camExposureTime);

            Dictionary<string, double> previousLightsIntensities = new Dictionary<string, double>();
            // Store light intensities
            foreach (var light in _hardwareManager.Lights)
            {
                previousLightsIntensities.Add(light.Key, light.Value.GetIntensity());
            }

            LiseHFSpotCheckFlow liseHFSpotCheckFlow;
            liseHFSpotCheckFlow = new LiseHFSpotCheckFlow(input);

            liseHFSpotCheckFlow.Execute();

            // We retrieve the current spot offset calibration if we send an evolution of the offset compared to the current calibration
            var spotOffsetMeasured = liseHFSpotCheckFlow.Result.SpotPosition;
            if (spotOffsetMeasured !=null)
            {
                probeLiseHFFDCProvider.CreateFDCLiseHFSpotOffsetDeviation(spotOffsetMeasured, objectiveSpotPosition);
            }
            // Restore light intensities
            foreach (var previousLightIntensity in previousLightsIntensities)
            {
                _hardwareManager.Lights[previousLightIntensity.Key].SetIntensity(previousLightIntensity.Value);
            }
        }

        public ProbeLiseHFCalibResult DoDummyCalibration(IProbeCalibParams probeCalibParams, IProbeInputParams inputParameters)
        {
            _logger.Information("Start Dummy Calibration LiseHF");
            var inputacq = inputParameters as LiseHFInputParams;
            var myProbeLiseHF = Probe as ProbeLiseHF;

            const double satthreshold = 65535.0;
            const int spectroPixelCount = 4096;

            var rand = new Random();
            try
            {
                var integrationTimeCalibration = _calibrationManager.GetLiseHFObjectiveIntegrationTime(inputacq.ObjectiveId);
                if (integrationTimeCalibration == null)
                    throw new Exception($"No integration time calibration has been set in HW Config for Objective <{inputacq.ObjectiveId}>");

                var integrationTime_ms = inputacq.IsLowIlluminationPower
                    ? integrationTimeCalibration.LowIllumFilterIntegrationTime_ms
                    : integrationTimeCalibration.StandardFilterIntegrationTime_ms;

                // Do the real calibration (not simulated)
                myProbeLiseHF.StopContinuousAcquisition();

                var cancellationTriggered = _cancellationTokenSrc.Token.WaitHandle.WaitOne(500);
                if (cancellationTriggered)
                    throw new Exception("Cancel request");

                myProbeLiseHF.Status = ProbeStatus.Calibration;
                var chuckConfig = _hardwareManager.Chuck.Configuration as ANAChuckConfig;
                var reflist = chuckConfig.ReferencesList;

                // DARK CALIBRATION
                //
                var RefDark = reflist.Find(x => x.ReferenceName == "REF DARK");
                if (RefDark == null)
                    RefDark = new OpticalReferenceDefinition() { PositionX = -210.Millimeters(), PositionY = -60.Millimeters(), PositionZ = 13.Millimeters() };

                // move to dark reference cale - if not exist in real world should be a user defined position (Z matters)
                HardwareUtils.MoveAxesToOpticalReference(_hardwareManager, RefDark);

                if (_cancellationTokenSrc.Token.IsCancellationRequested)
                    throw new Exception("Cancel request");

                _logger.Debug($"Performing Dark Calibration ...");
                var dkrawsig = new List<double>(_simulatedDark.Count);
                double noise = 10.0;
                foreach (var v in _simulatedDark)
                    dkrawsig.Add(v + noise * (rand.NextDouble() - 0.5));
                var DarkRawAcq = new RawCalibrationSignal() { WaveLength_nm = _simulatedWave.ToList(), RawSignal = dkrawsig };

                double MaxDark = DarkRawAcq.RawSignal.Max();
                double SatDark = MaxDark / satthreshold;
                var IsDarkValid = DarkRawAcq.RawSignal.Count == spectroPixelCount ? "OK" : "NOK";
                _logger.Debug($"Dark Calibration : Sat={SatDark * 100.0}% ({IsDarkValid})");
                var probeLiseHFFDCProvider = ClassLocator.Default.GetInstance<ProbeLiseHFFDCProvider>();
                probeLiseHFFDCProvider.CreateFDCLiseHFDarkCalibration(inputacq.ObjectiveId, inputacq.IsLowIlluminationPower, DarkRawAcq);

                // REFERENCE SILICON CALIBRATION
                //
                var RefSi = reflist.Find(x => x.ReferenceName == "REF SI");
                if (RefSi == null)
                    RefSi = new OpticalReferenceDefinition() { PositionX = -209.Millimeters(), PositionY = -17.Millimeters(), PositionZ = 0.8.Millimeters() };

                HardwareUtils.MoveAxesToOpticalReference(_hardwareManager, RefSi);

                if (_cancellationTokenSrc.Token.IsCancellationRequested)
                    throw new Exception("Cancel request");

                _logger.Debug($"Performing Reference Calibration ...");
                var refrawsig = new List<double>(_simulatedDark.Count);
                double refnoise = 30.0;
                foreach (var v in _simulatedRef)
                    refrawsig.Add(v + refnoise * (rand.NextDouble() - 0.5));
                var RefRawAcq = new RawCalibrationSignal() { WaveLength_nm = _simulatedWave.ToList(), RawSignal = refrawsig };

                double Maxref = RefRawAcq.RawSignal.Max();
                double Satref = Maxref / satthreshold;
                var IsRefValid = RefRawAcq.RawSignal.Count == spectroPixelCount ? "OK" : "NOK";
                _logger.Debug($"Reference Calibration : Sat={Satref * 100.0}% ({IsRefValid})");
                probeLiseHFFDCProvider.CreateFDCLiseHFRefCalibration(inputacq.ObjectiveId, inputacq.IsLowIlluminationPower, RefRawAcq);
                // calculate saturation threshold
                double Saturation = Math.Max(SatDark, Satref);

                IsCalibrationValid = (RefRawAcq.RawSignal.Count == spectroPixelCount) && (DarkRawAcq.RawSignal.Count == spectroPixelCount);
                if (!IsCalibrationValid)
                    _logger.Error($"Calibration LiseHF Not valid : Sat = {Saturation * 100.0}% rfcnt = {RefRawAcq.RawSignal.Count} | dkcnt = {DarkRawAcq.RawSignal.Count} != {spectroPixelCount}");


                var probeCalibration = new ProbeLiseHFCalibResult()
                {
                    Success = IsCalibrationValid,
                    ObjectiveId = inputacq.ObjectiveId,
                    IntegrationTime_ms = integrationTime_ms,
                    AttenuationId = ProbeLiseHF.IlluminationToSliderID(inputacq.IsLowIlluminationPower),
                    NbAverage = inputacq.NbMeasuresAverage,
                    DarkRawSignal = DarkRawAcq,
                    RefRawSignal = RefRawAcq,
                };

                return probeCalibration;

            }
            catch (Exception ex)
            {
                IsCalibrationValid = false;

                _logger.Error($"Calibration LiseHF : {ex.Message}");

                // notify error
                NotifyCalibrationResultsAvailable(new ProbeLiseHFCalibResult() { Success = false, ErrorMessage=ex.Message });
            }
            finally
            {
                // close shutter for safety
                myProbeLiseHF.CloseShutterAndWait(800); //should be already closed when called
                _logger.Information("Calibration LiseHF Terminated");

                myProbeLiseHF.Status = ProbeStatus.Initialized;
            }

            // Old way
            // remove it if simulated calibration is sastify
            var nbIterations = 5;
            var token = _cancellationTokenSrc.Token;
            while ((!token.IsCancellationRequested) && nbIterations > 0)
            {
                /// Processing
                var cancellationTriggered = token.WaitHandle.WaitOne(1000);
                if (cancellationTriggered)
                {
                    // Cleanup
                    break;
                }
                nbIterations--;
            }

            if (!token.IsCancellationRequested)
            {
                var DarkRawAcq = new RawCalibrationSignal() { WaveLength_nm = _simulatedWave.ToList(), RawSignal = _simulatedDark.ToList() };
                var RefRawAcq = new RawCalibrationSignal() { WaveLength_nm = _simulatedWave.ToList(), RawSignal = _simulatedRef.ToList() };

                IsCalibrationValid = true;


                var probeCalibration = new ProbeLiseHFCalibResult()
                {
                    Success = IsCalibrationValid,
                    ObjectiveId = inputacq.ObjectiveId,
                    IntegrationTime_ms = inputacq.IntegrationTimems,
                    AttenuationId = ProbeLiseHF.IlluminationToSliderID(inputacq.IsLowIlluminationPower),
                    NbAverage = inputacq.NbMeasuresAverage,
                    DarkRawSignal = DarkRawAcq,
                    RefRawSignal = RefRawAcq,
                };
                return probeCalibration;

            }

            return null;
        }

        public void NotifyCalibrationResultsAvailable(ProbeLiseHFCalibResult probeCalibResults)
        {
            probeCalibResults.ProbeID = Probe.DeviceID;
            var probeServiceCallback = ClassLocator.Default.GetInstance<IProbeServiceCallbackProxy>();
            probeServiceCallback.ProbeCalibrationResultsCallback(probeCalibResults);
        }

